import React from 'react';
import {Link} from 'react-router-dom'

export default function Navbar (){
    return(
        <>
          <Link to='/'>Home</Link>
          <Link to='/saleswhale'>Why Saleswhale?</Link>
          <Link to='/product'>Product</Link>
          <Link to='/company'>Company</Link>
        </>
    )
}
